import React from "react";

export default function UncontrolledComponent() {
  function handleSubmit() {}

  return (
    <form onSubmit={this.handleSubmit}>
      <label>
        Upload file:
        <input type="file" ref={this.fileInput} />
      </label>
      <br />
      <button type="submit">Submit</button>
    </form>
  );
}
